	constructor(props) {
		super(props)

		const movies = [
			{id:0, title:"Avengers: Infinity War", overview: "summary"},
			{id:1, title:"Avengers", overview: "summary"}
		]

		this.state = {row: [
			<p key="1">this is my row0</p>,
			<p key="2">this is my row1</p>,
			<p key="3">this is my row2</p>
		]}

		var movieRows = [];
		movies.forEach((movie) => {
			console.log(movie.id)
			const movieGrid = 
			
			<div class="card" style="width: 18rem;">
  <img class="card-img-top" src="..." alt="Card image cap"/>
  <div class="card-body">
    <h5 class="card-title">Card title</h5>
    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
  </div>
  <ul class="list-group list-group-flush">
    <li class="list-group-item">Cras justo odio</li>
    <li class="list-group-item">Dapibus ac facilisis in</li>
    <li class="list-group-item">Vestibulum at eros</li>
  </ul>
  <div class="card-body">
    <a href="#" class="card-link">Card link</a>
    <a href="#" class="card-link">Another link</a>
  </div>
</div>

		movieRows.push(movieGrid)
		})

		this.state = {rows: movieRows};
	}
render() {
return(
	<div>
	<div class="search-container">
  		<div class="row">
    		<div class="col-sm">
      			<input className="search-bar" placeholder="Please enter movie name"/>
    		</div>
  		</div>
	</div>
	<div class="card-container">
	{this.state.rows}
	</div>
</div>
	)
	}
}

export default MovieSearch;
